-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
`order_id`  int(100) NOT NULL AUTO_INCREMENT ,
`product_id`  int(11) NULL DEFAULT NULL ,
`price`  decimal(8,2) NULL DEFAULT NULL ,
`ocount`  int(11) NULL DEFAULT NULL ,
`total_price`  decimal(8,2) NULL DEFAULT NULL ,
`user_id`  int(11) NULL DEFAULT NULL ,
`address_id`  int(11) NULL DEFAULT NULL ,
`cart_id`  int(11) NULL DEFAULT NULL ,
`stauts`  int(11) NULL DEFAULT NULL ,
`flag`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`buid_time`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`orderno`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
PRIMARY KEY (`order_id`),
FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`address_id`) REFERENCES `address` (`address_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`cart_id`) REFERENCES `goods_cart` (`cart_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `product_id` (`product_id`) USING BTREE ,
INDEX `user_id` (`user_id`) USING BTREE ,
INDEX `address_id` (`address_id`) USING BTREE ,
INDEX `cart_id` (`cart_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=11

;

