-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
`product_id`  int(100) NOT NULL AUTO_INCREMENT ,
`category_id`  int(11) NULL DEFAULT NULL ,
`shop_id`  int(11) NULL DEFAULT NULL ,
`product_name`  varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`product_price`  decimal(8,2) NULL DEFAULT NULL ,
`product_img_url`  varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`product_uprice`  decimal(8,2) NULL DEFAULT NULL ,
`product_num`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`product_detail`  text CHARACTER SET utf8 COLLATE utf8_general_ci NULL ,
`product_comment_num`  int(8) NULL DEFAULT NULL ,
`product_hot`  int(11) NULL DEFAULT NULL ,
`product_special`  int(11) NULL DEFAULT NULL ,
`product_search_hot`  int(8) NULL DEFAULT NULL ,
PRIMARY KEY (`product_id`),
FOREIGN KEY (`product_id`) REFERENCES `category` (`category_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`product_id`) REFERENCES `shop` (`shop_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=244

;

